import React, { useEffect } from "react";
import AdminSidebar from "../../components/sidebars/adminSidebar";
import {
	Stack,
	Typography,
	FormControl,
	OutlinedInput,
	InputAdornment,
	IconButton,
	Dialog,
	DialogActions,
	DialogTitle,
	Button,
	Slide,
} from "@mui/material";
import { DataGrid } from "@mui/x-data-grid";
import SearchIcon from "@mui/icons-material/Search";

const Transition = React.forwardRef(function Transition(props, ref) {
	return <Slide direction="up" ref={ref} />;
});

function RevokeAccessPage() {
	const [searchQuery, setSearchQuery] = React.useState("");
	const [retailers, setRetailers] = React.useState([]);
	const [dataOpen, setDataOpen] = React.useState(false);

	// Fetch retailers from the server
	async function getRetailers() {
		console.log("Fetching retailers...");
		const token = localStorage.getItem("token");
		if (!token) {
			console.error("Token is missing in localStorage");
			return;
		}

		try {
			const response = await fetch(
				"http://localhost:5000/access/getListOfRetailers",
				{
					method: "POST",
					headers: {
						jwt_token: token,
						"Content-type": "application/json",
					},
					body: JSON.stringify({ name: searchQuery }),
				}
			);
			if (!response.ok) {
				throw new Error(`HTTP error! status: ${response.status}`);
			}

			const parseRes = await response.json();
			console.log("Retailers fetched:", parseRes);

			const tempRows = parseRes.map((pr) => ({
				id: pr.r_id,
				Retailer_Name: pr.r_name,
				Mobile_Number: pr.r_mobile_num,
			}));

			setRetailers(tempRows);
		} catch (err) {
			console.error("Error fetching retailers:", err);
		}
	}

	useEffect(() => {
		getRetailers();
	}, [searchQuery]);

	const columns = [
		{ field: "id", headerName: "Retailer_ID", width: 500 },
		{ field: "Retailer_Name", headerName: "Retailer_Name", width: 300 },
		{ field: "Mobile_Number", headerName: "Mobile_Number", width: 400 },
	];

	const handleDataOpen = () => {
		setDataOpen(true);
	};

	const handleDataClose = () => {
		setDataOpen(false);
	};

	async function handleDeletion() {
		console.log("Deleting retailer...");
		const token = localStorage.getItem("token");
		const r_id = localStorage.getItem("id");

		try {
			const response = await fetch(
				"http://localhost:5000/access/handleRetailerDeletion",
				{
					method: "POST",
					headers: {
						jwt_token: token,
						"Content-type": "application/json",
					},
					body: JSON.stringify({ r_id }),
				}
			);

			if (!response.ok) {
				throw new Error(`HTTP error! status: ${response.status}`);
			}

			const parseRes = await response.json();
			console.log("Retailer deleted:", parseRes);

			handleDataClose();
			localStorage.removeItem("id");
			getRetailers();
		} catch (err) {
			console.error("Error deleting retailer:", err);
		}
	}

	return (
		<div>
			<Stack direction="row">
				<AdminSidebar />
				<Stack direction="column" sx={{ marginLeft: 5, marginTop: 4 }}>
					<Typography sx={{ fontSize: 40, color: "white" }}>
						RETAILER ACCESSES
					</Typography>
					<FormControl>
						<OutlinedInput
							onChange={(e) => setSearchQuery(e.target.value)}
							endAdornment={
								<InputAdornment position="end">
									<IconButton>
										<SearchIcon />
									</IconButton>
								</InputAdornment>
							}
							sx={{ backgroundColor: "#05447a", color: "white" }}
						/>
					</FormControl>
					<DataGrid
						rows={retailers}
						columns={columns}
						pageSize={5}
						sx={{ height: 400, marginTop: 2 }}
						onRowDoubleClick={(e) => {
							localStorage.setItem("id", e.row.id);
							handleDataOpen();
						}}
					/>
					<Dialog
						open={dataOpen}
						TransitionComponent={Transition}
						keepMounted
						onClose={handleDataClose}
					>
						<DialogTitle>{"Revoke Access"}</DialogTitle>
						<DialogActions>
							<Button onClick={handleDataClose}>Cancel</Button>
							<Button
								color="error"
								variant="contained"
								onClick={handleDeletion}
							>
								Revoke
							</Button>
						</DialogActions>
					</Dialog>
				</Stack>
			</Stack>
		</div>
	);
}

export default RevokeAccessPage;
